const { startClient } = require('flextag-protocol/client')
// const EventEmitter = require('eventemitter3')
// const debug = require('debug')('live-source-proxy/client')
// const KeyedSet = require('keyed-set')
const livesource = require('live-source')

function client (addr) {
  const wsaddr = addr.replace(/^http/, 'ws')
  const toServer = startClient(wsaddr, [talker])
  let activeConn

  const world = new livesource.Opener()
  console.log({ world })
  world.addOpener(open)

  toServer.on('close', () => {
    activeConn = undefined // don't be trying to send() when closed
  })

  world.stop = () => { toServer.stop() }
  world.toServer = toServer // in case you want to talk about other stuff
  return world

  function open (url, options) {
    const obj = new livesource.LiveSource(url, options)
    obj.lastClose = () => {
      if (activeConn) {
        activeConn.send('close ?url', { url })
      }
    }
    if (activeConn) sub(obj) // otherwise on-connected will take care of it

    return obj
  }

  function talker (conn) {
    activeConn = conn
    for (const obj of world.docs) {
      sub(obj)
    }

    conn.onMatch('Metascraper results for URL ?url in JSON: ?json', ({ url, json }) => {
      const doc = world.docs.get(url)
      const meta = JSON.parse(json)
      doc.meta = meta
      doc.emit('change')
      console.warn('GOT Meta', meta)
    })

    conn.onMatch('content type of ?url is ?contentType', ({ url, contentType }) => {
      const doc = world.docs.get(url)
      doc.contentType = contentType
      console.warn('doc.contentType = ', contentType)
      doc.emit('change')
    })

    conn.onMatch('new text of ?url is ?text', b => {
      const doc = world.docs.get(b.url)
      // doc.date, contentType, errorCode, error, lastFetch ?
      if (!doc) {
        console.error('Huh? No doc with url for', b)
      }
      doc.text = b.text
      console.log('recv new of', b.url, ':', b.text.slice(0, 30), '...')

      if (world.formats) {
        for (const format of world.formats) {
          format.run(doc)
        }
      }
      if (doc.changed === undefined || doc.changed === true) {
        doc.emit('change', doc)
      }
    })
  }

  function sub (obj) {
    console.log('subscribe', obj.url)
    if (obj.poll) {
      activeConn.send('Please start sending me updates on URL ?url, polling no more than once per ?(poll)ms', obj)
    } else {
      activeConn.send('open ?url', obj)
    }
  }
}

module.exports = { client }

